('node', 'page', 0, 1, 1, 'und', 0, '<div class="contentleft home">\r\n"At the <span class="special">Crisp Law Firm, </span>we have a personal relationship<br> with each individual we represent and are <span class="special">commited</span> to<br> devoting all of the time and resources necessary to achieve the<br><span class="special">very best results for our clients.</span>"\r\n<div class="name">\r\nHUGH E. CRISP & JORDAN RUTLEDGE   <img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/nameright.png''; ?>" />\r\n</div>\r\n</div>\r\n<div class="contentright" style="text-align:left;">\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/crisplaw.png''; ?>" />\r\n</div>', '', 'php_code'),
('node', 'page', 0, 2, 2, 'und', 0, '<div class="contentleftimg" style="width:50%">\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/about_us.gif''; ?>" />\r\n</div>\r\n<div class="contentrightcontent" style="width:50%">\r\n<h2 style="margin-top:0;">CRISP LAW FIRM</h2>\r\n<p>Crisp Law Firm was formed under the premise that each client would be represented and treated with a personalized approach and that all of the time and resources necessary to achieve the very best results would be expended on each case. Cases are selectively chosen to ensure that each client is represented with an absolute personal commitment to their case.</p>\r\n<br/><br/><br/><br/>\r\n<ul>\r\n<li><a href="<?php print base_path() . ''node/5''; ?>"><span class="name">HUGE E. CRISP, <i>ATTORNEY</i></span></a>&nbsp;&nbsp;&nbsp;<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/name_list.png''; ?>" /></li>\r\n<li><a href="<?php print base_path() . ''node/6''; ?>"><span class="name">JORDAN RUTLEDGE, <i> ATTORNEY</i></span></a>&nbsp;&nbsp;&nbsp;<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/name_list.png''; ?>" /></li>\r\n</ul>\r\n</div>', '', 'php_code'),
('node', 'page', 0, 3, 3, 'und', 0, '<div class="contentleft">\r\n<ul>\r\n<li class="active"><a href="<?php print base_path() . ''node/3''; ?>">MEDICAL MALPRACTICE</a></li>\r\n<li><a href="<?php print base_path() . ''node/8''; ?>">PERSONAL INJURY</a></li>\r\n<li><a href="<?php print base_path() . ''node/7''; ?>">NURSING HOME ABUSE & NEGLECT</a></li>\r\n<li><a href="<?php print base_path() . ''node/11''; ?>">WRONGFUL DEATH</a></li>\r\n<li><a href="<?php print base_path() . ''node/9''; ?>">VIDEO DEPOSITIONS & REENACTMENTS</a></li>\r\n</ul>\r\n<h2>\r\nMEDICAL MALPRACTICE</h2>\r\n<p>When a physician, nurse, hosipital or other medical care provider fails to uphold the standard of medical care required and causes harm to a patient, the victem of that medical negligence may be able to recover for the injuries and damages sustained through a medical malpractice lawsuit. We use only the most highly qualified and credible experts in their specialty and field of expertise in order to properly evaluate potential medical malpractice claims and to testify in the cases that are meritorious. We handle cases involving, birth insuries, spinal cord, injuries, brain injuries, surgical malpractice and the failure to diafnoses and treat medical conditions in all medical specialties.</p>\r\n<h2>WHAT IS MEDICAL MALPRACTICE?</h2>\r\n<p>Medical Malpractice occurs when a medical care provider causes injury or harm to a patient as a result of their negligence, error or omission to provide adequate treatment to the patient.</p>\r\n</div>\r\n<div class="contentright">\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/medical.png''; ?>" />\r\n</div>\r\n\r\n\r\n<ul>\r\n<li>Some example of medical malpractice are:</li>\r\n<li>- Failure to diagnose</li>\r\n<li>- Patient Abandonment</li>\r\n<li>- Failure to conduct appropriate testing of a patient</li>\r\n<li>- Failure to appropriatly assess a patient</li>\r\n<li>- Failure to take the necessary emergent actions requird</li>\r\n<li>- Failure to properly maintain equipment or appliances necessary for medical services</li>\r\n<li>- Failure to use the requisite skill to perform a medical procedure</li>\r\n<li>- Failure to obtain informed consent of a patient</li>\r\n<li>- Failure to disclose the risks and complications associated with a medical procedure.</li>\r\n</ul>\r\n<h2>WHAT IS A MEDICAL MALPRACTICE LAWSUIT?</h2>\r\n<p>Arkansas law allows for a person who is injured as a result of negligence by a medical care provider to have the opporttunity to recover compensation with the goal of making that individual "whole" again. While monetary compensation can never fully make a person "whole" after a medical injury, monetary losses may be sought to compensate for the patient''s damages as a result of the injury. Examples of quantifiable damages are past and future medical expenses, past and future lost wages, rehabilitation services, custodial care and loss of earning capacity. In adddition, injured patients are also allowed to recover for damages such as pain and suffering, mental anguish and loss of enjoyment of life due to the injuries that the patient has sustained.</p>\r\n<h2>WHAT SHOULD I DO IF I BELIEVE HAVE A POTENTIAL CLAIM FOR MEDICAL MALPRACTICE?</h2>\r\n<p>If you believe you may have a potential claim for medical malpractice, you should contact an attorney immediately. There is a time limit as to how long you have to file a medical malpractice lawsuit, so time is of the essence in contacting an attorney. At the Crisp Law Firm, we have extensive experience handling medical malpractice lawsuites and evaluate your case by determining whether the following occurred:</p>\r\n<ul>\r\n<li>1) The medical care provider was negligent in the care and treatment of a patient;</li>\r\n<li>2) The medical care provider''s negligence caused injury or harm to the patient; and</li>\r\n<li>3) As a result of the injury or harm to the patient, the patint sustained damages.</li>\r\n</ul>\r\n<p>If you believe you have a potential claim, please contact us or fill out our case evaluation form.</p>', '', 'php_code'),
('node', 'page', 0, 4, 4, 'und', 0, '<div class="contentleftimg" style="width:50%">\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/contact.png''; ?>" />\r\n</div>\r\n<div class="contentrightcontent" style="width:50%">\r\n<h2 style="margin-top:0;">CRISP LAW FIRM</h2>\r\n<p>\r\n823 WEST MARKHAM ST, STE. 300<br>\r\nLITTLE ROCK, ARKANSAS 72201<br>\r\nP: (501)376-6264 | F: (501)376-1589\r\n</p>\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/contactmap.png''; ?>" />\r\n<p>If you believe you have a potential<br> claim, please contact us or fill out a</p>\r\n<ul>\r\n<li><a href="<?php print base_path() . ''node/10''; ?>"><span class="name">CASE EVALUATION FORM</span></a></li>\r\n</ul>\r\n</div>', '', 'php_code'),
('node', 'page', 0, 5, 5, 'und', 0, '<div class="contentleftimg">\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/crisp.png''; ?>" />\r\n<br/>\r\n<ul>\r\n<li><a href="<?php print base_path() . ''node/6''; ?>"><span class="name">JORDAN RUTLEDGE, <i>ATTORNEY</i></span></a></li>\r\n<li><a href="<?php print base_path() . ''node/2''; ?>"><span class="name">CRISP LAW FIRM, <i> ABOUT US</i></span></a></li>\r\n</ul>\r\n</div>\r\n<div class="contentrightcontent">\r\n<p>\r\nHugh E. Crisp exclusively handles personal injury litigation with emphasis on catastrophic injuries and medical malpractice, in the Mid-South.\r\n</p>\r\n<p>\r\nMr. Crisp has been recognized on numerous occasions by the Arkansas Times as "One of the Best Lawyers in Arkansas" in the field of malpractice and is rated "AV" by Martindale-Hubbellm the highest rating for an attorney practicing in the United States. He has been selected three times as a "super Lawyer" by his peers and through the selection process by the publishers of Mid-South Super Lawyers that covers Arkansas, Mississippi, and Tennessee.\r\n</p>\r\n<p>\r\nMr. Crisp has been awarded the Civil Justice Advocacy Award by the Arkansas Trial Lawyers Association for "extraordinary dedication, commitment and service to the legal profession and the citizens of Arkansas for commitment to the preservation of the civil justice system and the protection of rights of the cosumers."\r\n</p>\r\n</div>', '', 'php_code'),
('node', 'page', 0, 6, 6, 'und', 0, '<div class="contentleftimg">\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/jordan.png''; ?>" />\r\n<br/>\r\n<ul>\r\n<li><a href="<?php print base_path() . ''node/5''; ?>"><span class="name">HUGE E. CRISP, <i>ATTORNEY</i></span></a></li>\r\n<li><a href="<?php print base_path() . ''node/2''; ?>"><span class="name">CRISP LAW FIRM, <i> ABOUT US</i></span></a></li>\r\n</ul>\r\n</div>\r\n<div class="contentrightcontent">\r\n<p>Jordan Rutledge joined the Crisp Law Firm in 2010. She is experienced in many facts of litigation including initial case assessment, management and coordination of discovery, depositions, pre-trial motions and trial preparation. Her training as a certified mediator enables her to understand the complexities of conflict resolution in advocating for her clients during both informal negotiation and dispute resolution.</p>\r\n<h2 style="margin-top:0;">EDUCATION</h2>\r\n<p>University of Arkansas, School of Law, Juris Doctorate, 2010<br>\r\nQualchita Baptist University, Bachelor of Arts, magna cum laude, 2006\r\n</p>\r\n<h2>\r\nADMISSIONS</h2>\r\n<p>Arkansas, 2010<br>\r\nUnited States District Court, Eastern District of Arkansas<br>\r\nUnited States District Court, Western District of Arkansas\r\n</p>\r\n<h2>CERTIFIED MEDIATOR</h2>\r\n<p>Arkansas Alternative Dispute Resolution</p>\r\n<h2>ASSOCIATIONS & MEMBERSHIPS</h2>\r\n<p>Arkansas Bas Association<br>\r\nVOCALS (Volunteer Organization of Center for Arkansas Legal Services)<br>\r\nJunior League of Little Rock</p>\r\n</div>', '', 'php_code'),
('node', 'page', 0, 7, 7, 'und', 0, '<div class="contentleft">\r\n<ul>\r\n<li><a href="<?php print base_path() . ''node/3''; ?>">MEDICAL MALPRACTICE</a></li>\r\n<li><a href="<?php print base_path() . ''node/8''; ?>">PERSONAL INJURY</a></li>\r\n<li class="active"><a href="<?php print base_path() . ''node/7''; ?>">NURSING HOME ABUSE & NEGLECT</a></li>\r\n<li><a href="<?php print base_path() . ''node/11''; ?>">WRONGFUL DEATH</a></li>\r\n<li><a href="<?php print base_path() . ''node/9''; ?>">VIDEO DEPOSITIONS & REENACTMENTS</a></li>\r\n</ul>\r\n<h2>NURSING HOME ABUSE & NEGLECT</h2>\r\n<p>When your loved ones need additional care when they are no longer able to care for themselves in their home or by others, a nursing home is many times the only option. Unfortunately, the most frail and vulnerable members of our society receive deplorable care in nursing homes throughout our country resulting in bedsores, falls, dehydration, malnutrition, assaults and filthy living conditions. At Crisp Law Firm, we have extensive experience in handling nursing home abuse and neglect claims and have recovered millions of dollars for victims and their families of nursing home abuse and neglect. </p>\r\n<h2>COMMON SIGNS OF ABUSE & NEGLECT</h2>\r\n<ul>\r\n<li>- Frequent Falls</li>\r\n<li>- Excessive and sudden weight loss</li>\r\n<li>- Bed sores</li>\r\n<li>- Dehydration</li>\r\n<li>- Malnutrition</li>\r\n<li>- Poor personal hygiene</li>\r\n<li>- Bruising</li>\r\n<li>- Withdraw from social activities</li>\r\n<li>- Depression</li>\r\n</ul>\r\n<p>If you believe you have a potential claim, please contact us or fill out our case evaluation form.</p>\r\n</div>\r\n<div class="contentright">\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/nursing.gif''; ?>" />\r\n</div>', '', 'php_code'),
('node', 'page', 0, 8, 8, 'und', 0, '<div class="contentleft">\r\n<ul>\r\n<li><a href="<?php print base_path() . ''node/3''; ?>">MEDICAL MALPRACTICE</a></li>\r\n<li class="active"><a href="<?php print base_path() . ''node/8''; ?>">PERSONAL INJURY</a></li>\r\n<li><a href="<?php print base_path() . ''node/7''; ?>">NURSING HOME ABUSE & NEGLECT</a></li>\r\n<li><a href="<?php print base_path() . ''node/11''; ?>">WRONGFUL DEATH</a></li>\r\n<li><a href="<?php print base_path() . ''node/9''; ?>">VIDEO DEPOSITIONS & REENACTMENTS</a></li>\r\n</ul>\r\n<h2>\r\nPERSONAL INJURY</h2>\r\n<p>Personal injuries can have devastation effects on victims, leaving some seriously injured, permanently disabled and financially destroyed. If you have suffered an injury due to the negligence of another, you may have a claim for personal injury. At the Crisp Law Firm, we have over thirty years of experience handling various types of claims for serious injuries including car accidents, trucking accidents, construction accidents, slip and falls, explosions and accidents involving drunk drivers. A victim of personal injury lawsuit may seek damages for, but not limited to the following:\r\n</p>\r\n</div>\r\n<div class="contentright">\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/personal-injury.gif''; ?>" />\r\n</div>\r\n\r\n<ul>\r\n<li>-Past and future medical bills</li>\r\n<li>-Lost wages</li>\r\n<li>-Pain and Suffering</li>\r\n<li>-Property Damage</li>\r\n</ul>\r\n<h2>Personal Injuries Require Immediate Action</h2>\r\n<p>Injuries and death caused from a trucking accident or automobile accident require prompt investigation. Reckless driving, driving under the influence and failure to obey traffic signs are just a few of the common causes of wrecks. Injuries and death caused from a trucking accident or automobile accident require prompt investigation. We are prepared to immediately dispatch an accident reconstructionist to the scene of the accident in order to obtain all information possible and to preserve vital evidence. Most trucking companies dispatch their investigators and accident reconstructionist to the scene immediately upon hearing of the accident. Time is of the essence for victims of these accidents to hire an attorney as soon as possible to protect their rights. Immediate action is also required to investigate serious injuries and death claims occurring on a construction site or industrial location. An injured victim should be aware that personal injury claims must be brought within a specific period of time following the date that the injury occurred. For this reason, it is important to contact an attorney as soon as possible. </p>\r\n<p>If you believe you have a potential claim, please contact us or fill out our case evaluation form.</p>', '', 'php_code'),
('node', 'page', 0, 9, 9, 'und', 0, '<div class="contentleft">\r\n<ul>\r\n<li><a href="<?php print base_path() . ''node/3''; ?>">MEDICAL MALPRACTICE</a></li>\r\n<li><a href="<?php print base_path() . ''node/8''; ?>">PERSONAL INJURY</a></li>\r\n<li><a href="<?php print base_path() . ''node/7''; ?>">NURSING HOME ABUSE & NEGLECT</a></li>\r\n<li><a href="<?php print base_path() . ''node/11''; ?>">WRONGFUL DEATH</a></li>\r\n<li class="active"><a href="<?php print base_path() . ''node/9''; ?>">VIDEO DEPOSITIONS & REENACTMENTS</a></li>\r\n</ul>\r\n<h2>VIDEO DEPOSITIONS & REENACTMENTS</h2>\r\n<p>Video depositions are very compelling, not only revealing the facts, but preserving the testimony of witnesses prior to trial.  Professional videographers and production crews are retained by the Crisp Law Firm to capture and edit deposition footage and interviews.  Deposition excerpts are synced with video testimony to give a clear picture of the deponent’s response.</p>\r\n<p>Reenactments are essential to any case.  Taking the viewer visually through an accident or medical procedure with amazing accuracy and realism eliminates any misinterpretation of facts.</p>\r\n<p>If you believe you have a potential claim, please contact us or fill out our case evaluation form.</p>\r\n</div>\r\n<div class="contentright">\r\n\r\n<a href="#"><img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/video.gif''; ?>" /></a>\r\n</div>', '', 'php_code'),
('node', 'webform', 0, 10, 10, 'und', 0, 'Please take a moment to fill out the form below. We will use this information to contact you. At the Crisp Law Firm, \r\nwe value your privacy. We will not share any of this personal information with a third party without consulting you first.\r\n\r\n* Indicates required field', '', 'php_code'),
('node', 'page', 0, 11, 11, 'und', 0, '<div class="contentleft">\r\n<ul>\r\n<li><a href="<?php print base_path() . ''node/3''; ?>">MEDICAL MALPRACTICE</a></li>\r\n<li><a href="<?php print base_path() . ''node/8''; ?>">PERSONAL INJURY</a></li>\r\n<li><a href="<?php print base_path() . ''node/7''; ?>">NURSING HOME ABUSE & NEGLECT</a></li>\r\n<li class="active"><a href="<?php print base_path() . ''node/11''; ?>">WRONGFUL DEATH</a></li>\r\n<li><a href="<?php print base_path() . ''node/9''; ?>">VIDEO DEPOSITIONS & REENACTMENTS</a></li>\r\n</ul>\r\n<h2>WRONGFUL DEATH</h2>\r\n<p>When the death of a loved one is caused by a wrongful or neglectful act of another, the person, medical care provider, company or corporation responsible may be held liable for the damages by a representative of the deceased.  A variety of accidents can lead to wrongful death including, but not limited to:</p>\r\n<ul>\r\n<li>-Medical Malpractice</li>\r\n<li>-Automobile accidents</li>\r\n<li>-Workplace accidents</li>\r\n<li>-Construction accidents</li>\r\n<li>-Explosions</li>\r\n</ul>\r\n<p>We at the Crisp Law Firm understand that the death of a loved one is difficult and are prepared by experience to handle these matters with the care they deserve.</p>\r\n<p>If you believe you have a potential claim, please contact us or fill out our case evaluation form.</p>\r\n</div>\r\n<div class="contentright">\r\n<img src="<?php print base_path() . drupal_get_path(''theme'', ''bartik'') . ''/images/wrongful.gif''; ?>" />\r\n</div>', '', 'php_code');
