INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' home  at the crisp law firm we have a personal relationship with each individual we represent and are commited to devoting all of the time and resources necessary to achieve the very best results for our clients hugh e crisp jordan rutledge  ', 1347417455),
(2, 'node', ' about us crisp law firm crisp law firm was formed under the premise that each client would be represented and treated with a personalized approach and that all of the time and resources necessary to achieve the very best results would be expended on each case cases are selectively chosen to ensure that each client is represented with an absolute personal commitment to their case huge e crisp  attorney   jordan rutledge  attorney   ', 1347417829),
(3, 'node', ' practice medical malpractice personal injury nursing home abuse neglect wrongful death video depositions reenactments medical malpractice when a physician nurse hosipital or other medical care provider fails to uphold the standard of medical care required and causes harm to a patient the victem of that medical negligence may be able to recover for the injuries and damages sustained through a medical malpractice lawsuit we use only the most highly qualified and credible experts in their specialty and field of expertise in order to properly evaluate potential medical malpractice claims and to testify in the cases that are meritorious we handle cases involving birth insuries spinal cord injuries brain injuries surgical malpractice and the failure to diafnoses and treat medical conditions in all medical specialties what is medical malpractice  medical malpractice occurs when a medical care provider causes injury or harm to a patient as a result of their negligence error or omission to provide adequate treatment to the patient some example of medical malpractice are failure to diagnose patient abandonment failure to conduct appropriate testing of a patient failure to appropriatly assess a patient failure to take the necessary emergent actions requird failure to properly maintain equipment or appliances necessary for medical services failure to use the requisite skill to perform a medical procedure failure to obtain informed consent of a patient failure to disclose the risks and complications associated with a medical procedure what is a medical malpractice lawsuit  arkansas law allows for a person who is injured as a result of negligence by a medical care provider to have the opporttunity to recover compensation with the goal of making that individual whole again while monetary compensation can never fully make a person whole after a medical injury monetary losses may be sought to compensate for the patient s damages as a result of the injury examples of quantifiable damages are past and future medical expenses past and future lost wages rehabilitation services custodial care and loss of earning capacity in adddition injured patients are also allowed to recover for damages such as pain and suffering mental anguish and loss of enjoyment of life due to the injuries that the patient has sustained what should i do if i believe have a potential claim for medical malpractice  if you believe you may have a potential claim for medical malpractice you should contact an attorney immediately there is a time limit as to how long you have to file a medical malpractice lawsuit so time is of the essence in contacting an attorney at the crisp law firm we have extensive experience handling medical malpractice lawsuites and evaluate your case by determining whether the following occurred 1 the medical care provider was negligent in the care and treatment of a patient 2 the medical care provider s negligence caused injury or harm to the patient and 3 as a result of the injury or harm to the patient the patint sustained damages if you believe you have a potential claim please contact us or fill out our case evaluation form  ', 1347418179),
(4, 'node', ' contact crisp law firm 823 west markham st ste 300 little rock arkansas 72201 p 5013766264 f 5013761589 if you believe you have a potential claim please contact us or fill out a case evaluation form ', 1347418491),
(5, 'node', ' crisp jordan rutledge  attorney crisp law firm  about us hugh e crisp exclusively handles personal injury litigation with emphasis on catastrophic injuries and medical malpractice in the midsouth mr crisp has been recognized on numerous occasions by the arkansas times as one of the best lawyers in arkansas in the field of malpractice and is rated av by martindalehubbellm the highest rating for an attorney practicing in the united states he has been selected three times as a super lawyer by his peers and through the selection process by the publishers of midsouth super lawyers that covers arkansas mississippi and tennessee mr crisp has been awarded the civil justice advocacy award by the arkansas trial lawyers association for extraordinary dedication commitment and service to the legal profession and the citizens of arkansas for commitment to the preservation of the civil justice system and the protection of rights of the cosumers  ', 1347417971),
(6, 'node', ' jordan huge e crisp  attorney crisp law firm  about us jordan rutledge joined the crisp law firm in 2010 she is experienced in many facts of litigation including initial case assessment management and coordination of discovery depositions pretrial motions and trial preparation her training as a certified mediator enables her to understand the complexities of conflict resolution in advocating for her clients during both informal negotiation and dispute resolution education university of arkansas school of law juris doctorate 2010 qualchita baptist university bachelor of arts magna cum laude 2006 admissions arkansas 2010 united states district court eastern district of arkansas united states district court western district of arkansas certified mediator arkansas alternative dispute resolution associations memberships arkansas bas association vocals volunteer organization of center for arkansas legal services junior league of little rock  ', 1347418065),
(7, 'node', ' medical malpractice medical malpractice personal injury nursing home abuse neglect wrongful death video depositions reenactments nursing home abuse neglect when your loved ones need additional care when they are no longer able to care for themselves in their home or by others a nursing home is many times the only option unfortunately the most frail and vulnerable members of our society receive deplorable care in nursing homes throughout our country resulting in bedsores falls dehydration malnutrition assaults and filthy living conditions at crisp law firm we have extensive experience in handling nursing home abuse and neglect claims and have recovered millions of dollars for victims and their families of nursing home abuse and neglect common signs of abuse neglect  frequent falls excessive and sudden weight loss bed sores dehydration malnutrition poor personal hygiene bruising withdraw from social activities depression if you believe you have a potential claim please contact us or fill out our case evaluation form  ', 1347418318),
(8, 'node', ' personal injury medical malpractice personal injury nursing home abuse neglect wrongful death video depositions reenactments personal injury personal injuries can have devastation effects on victims leaving some seriously injured permanently disabled and financially destroyed if you have suffered an injury due to the negligence of another you may have a claim for personal injury at the crisp law firm we have over thirty years of experience handling various types of claims for serious injuries including car accidents trucking accidents construction accidents slip and falls explosions and accidents involving drunk drivers a victim of personal injury lawsuit may seek damages for but not limited to the following past and future medical bills lost wages pain and suffering property damage personal injuries require immediate action injuries and death caused from a trucking accident or automobile accident require prompt investigation reckless driving driving under the influence and failure to obey traffic signs are just a few of the common causes of wrecks injuries and death caused from a trucking accident or automobile accident require prompt investigation we are prepared to immediately dispatch an accident reconstructionist to the scene of the accident in order to obtain all information possible and to preserve vital evidence most trucking companies dispatch their investigators and accident reconstructionist to the scene immediately upon hearing of the accident time is of the essence for victims of these accidents to hire an attorney as soon as possible to protect their rights immediate action is also required to investigate serious injuries and death claims occurring on a construction site or industrial location an injured victim should be aware that personal injury claims must be brought within a specific period of time following the date that the injury occurred for this reason it is important to contact an attorney as soon as possible if you believe you have a potential claim please contact us or fill out our case evaluation form  ', 1347418246),
(9, 'node', ' video medical malpractice personal injury nursing home abuse neglect wrongful death video depositions reenactments video depositions reenactments video depositions are very compelling not only revealing the facts but preserving the testimony of witnesses prior to trial professional videographers and production crews are retained by the crisp law firm to capture and edit deposition footage and interviews deposition excerpts are synced with video testimony to give a clear picture of the deponent s response reenactments are essential to any case taking the viewer visually through an accident or medical procedure with amazing accuracy and realism eliminates any misinterpretation of facts if you believe you have a potential claim please contact us or fill out our case evaluation form ', 1347418410),
(10, 'node', ' contact please take a moment to fill out the form below we will use this information to contact you at the crisp law firm we value your privacy we will not share any of this personal information with a third party without consulting you first indicates required field name address city state zip day phone evening phone fax phone email address are you 18 years of age yes no are you the victim yes no have you already retained an attorney for this matter yes no would you like a attorney to contact you yes no date of injury mm dd yyyy city state where injured description of injury  ', 0),
(11, 'node', ' wrongful death medical malpractice personal injury nursing home abuse neglect wrongful death video depositions reenactments wrongful death when the death of a loved one is caused by a wrongful or neglectful act of another the person medical care provider company or corporation responsible may be held liable for the damages by a representative of the deceased a variety of accidents can lead to wrongful death including but not limited to medical malpractice automobile accidents workplace accidents construction accidents explosions we at the crisp law firm understand that the death of a loved one is difficult and are prepared by experience to handle these matters with the care they deserve if you believe you have a potential claim please contact us or fill out our case evaluation form ', 1347417363);
